import React from 'react'

const Contactanos = () => {
    return ( 
        <div className='container'>
            <div>
                <div>
                    <h2>Formulario de contacto</h2>
                </div>
                <div>
                    <p>Recuerda que este formulario es para que uno de nuestros ejecutivos te contacten para finiquitar tu inscripcion y ser parte de nuestro banco</p>
                </div>
            </div>
        </div>
     );
}

export default Contactanos;
